choice.onclick:
///$debug
//Bascule valeurs et états des champs en fonction de l'utilisation ou non d'un template d'évènement
switchTemplateUse();

check.onclick:
///$debug
var /*Field2*/ currentCheckBoxField=meibo.getCurrentField();
var /*Field2*/ otherCheckBoxField=meibo.getField("TET_ISTEMPLATE");
// uncheck the other field
if(currentCheckBoxField.isChecked() && otherCheckBoxField.isChecked()){
  otherCheckBoxField.check(false);
}

var /*Field2*/ currentCheckBoxField=meibo.getCurrentField();
var /*Field2*/ otherCheckBoxField=meibo.getField("TET_ISPRIVATE");
// uncheck the other field
if(currentCheckBoxField.isChecked() && otherCheckBoxField.isChecked()){
  otherCheckBoxField.check(false);
}

radio.onclick:
meibo.getField("fkTAS_ID").setEnabled(true);

meibo.getField("TAS_NAME").setEnabled(false);
meibo.getField("TAS_PHONENUMBER").setEnabled(false);
meibo.getField("TAS_ADDR1").setEnabled(false);
meibo.getField("TAS_ADDR2").setEnabled(false);
meibo.getField("TAS_ADDR3").setEnabled(false);
meibo.getField("TAS_ZIPCODE").setEnabled(false);
meibo.getField("TAS_TOWN").setEnabled(false);
meibo.getField("TAS_STATE").setEnabled(false); 
meibo.getField("TCY_ID").setEnabled(false);
