resourcefed.param:
Address/TAS_ID/EventAddressPicker/false/false/0/0/var /*ResultSet*/ addressRs= meibo.executeResource("Address","TAS_ID=" + meibo.getFieldValue("fkTAS_ID"),1);
var /*Entry*/ addressEntry = addressRs.getEntry();

// Dans le cas du pays, l'objet "TCY_ID" étant un sélecteur basée sur le paramètre TCY_ALPHA3,
// on ne peut y écrire n'importe quel string
// C'est le trigramme du pays qu'il faut récupérer et passer en paramètre
var /*ResultSet*/ countryRs = meibo.executeResource("Country","TCY_ID=" + addressEntry.TCY_ID[0] ,1);
var /*Entry*/     country   = countryRs.getEntry().TCY_ALPHA3[0];


meibo.getField("TAS_NAME").setValue(addressEntry.TAS_NAME[0]);
meibo.getField("TAS_PHONENUMBER").setValue(addressEntry.TAS_PHONENUMBER[0]);
meibo.getField("TAS_ADDR1").setValue(addressEntry.TAS_ADDR1[0]);
meibo.getField("TAS_ADDR2").setValue(addressEntry.TAS_ADDR2[0]);
meibo.getField("TAS_ADDR3").setValue(addressEntry.TAS_ADDR3[0]);
meibo.getField("TAS_ZIPCODE").setValue(addressEntry.TAS_ZIPCODE[0]);
meibo.getField("TAS_TOWN").setValue(addressEntry.TAS_TOWN[0]);
meibo.getField("TAS_STATE").setValue(addressEntry.TAS_STATE[0]); 
meibo.getField("TCY_ID").setValue(country);
